import React, { PureComponent } from 'react';
import { WriterWrapper } from '../style';
class Writer extends PureComponent {
    render() {
        return (
            <WriterWrapper>
                <img className="pic" alt=''></img>
                <ListInfo>
                    <h4 className="title"></h4>
                    <p className="like"></p>
                </ListInfo>
            </WriterWrapper>
        )
    }
}

export default Writer;
